import { AntDesign, Entypo } from "@expo/vector-icons";
import theme from "../styles/theme";

const Back = () => <AntDesign
    name="caretleft"
    size={24}
    color={theme.fontColor1}
/>

const Forward = () => <AntDesign
    name="caretright"
    size={24}
    color={theme.fontColor1}
/>

const Home = () => <Entypo name="home" size={26} color={theme.fontColor1}/>

export {
    Back,
    Forward,
    Home
}
